@assaf_claudia @GuilhermeBoulos A burrice é momentânea, então historicamente:
Moisés chegou a Canaã terra prometida em 1300 a.c com o povo hebreu, atualmente conhecida como Israel e Palestina.
Os Filisteus por outro lado ocuparam a região costeira de Canaã 200 a.c e desde então vivem em conflito com os hebreus.
